import { useState, useEffect } from 'react'

function DrawBtn(){
	const[btnColor, setBtnColor] = useState("#000");
	return(
		<div className="centeredContainer">
		<style>{`
			.baseColor{background-color: "#000"}
			.changeColor{background-color: "#FFF"}
		`}</style>
		<button
			className = {"baseColor"}
			onClick = {() => setBtnColor((btnColor) => (btnColor === "baseColor" ? "changeColor" : "baseColor"))}
		>
		Test?
		</button>
		</div>
	);
}

export default DrawBtn
